import React from 'react';


const OrganismList = (props: { organisms: { map: (arg0: (organism: string, index: number) => JSX.Element) => React.ReactNode; }; }) => (
    <ul>
        {
            props.organisms.map((organism: string, index: number) => <li key={index}>{organism}</li>)
        }
    </ul>
);

export default OrganismList;
